Also important to the Department's decision was ensuring that the preferred alternative be feasible from a standpoint of implementation, monitoring, and enforcement. In general, the changes to the Task Force preferred were made to address the following key issues:
      "	ensure that MPA boundaries and regulation were simple, clear, and easily enforced;
      "	consider key policy issues such as existing kelp harvest leases, shoreline fishing access, and user group conflicts;
      "	ensure that the MLPA requirement to improve recreational opportunities in areas subject to minimal human disturbance was met for all types of recreation (both consumptive and non-consumptive);
      "	wherever possible, reduce potential impacts to existing uses and use patterns; and
      "	ensure that the scientific guidance provided in the process was fully considered.

The Department's preferred alternative was submitted to the California Fish and Game Commission (Commission) on June 22, 2006. After two public hearings with additional discussion and analysis of potential changes to Package P, the Commission selected its preferred alternative, which included portions of Package P and Package 3R. The Commission preferred alternative was approved on August 15, 2006. The formal regulatory process and California Environmental Quality Act review followed. The Commission adopted its preferred alternative by unanimous vote on April 13, 2007.

These data do not replace the legal description of boundaries found in Title 14, California Code of Regulations. Boundary waypoints as described in Title 14 are the only legal representation of these Marine Protected Areas.

